import "./Vision.css"
import React from "react";
import NavBar from "../../components/navbar/NavBar";
import LandingView from "../../components/landingView/LandingView";

export default function Vision() {

    return (
        <>
            <NavBar/>
            <LandingView headerText="In the heart of Batumi's scenic embrace, discover Ripple -" captionText="We believe our lives are enhanced when lived with Creativity, Connection, and Intent. Ripple is the place for that."/>

        </>
    )

}
